import React from 'react';
import SearchBar from '../SearchBar/SearchBar';
import {Box, IconButton, Input, Switch, useTheme} from '@mui/material';
import { ColorModeContext, tokens } from '../theme/theme';
import DarkModeOutlinedIcon from '@mui/icons-material/DarkModeOutlined';

export default function Navbar () {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);
    let themeToggle = React.useContext(ColorModeContext);

    return (
        <>
            <Box display={"flex"} width = {"100hv"} height = {"3rem"} justifyContent = {"space-between"} alignItems = {"center"}
            sx = {{
                backgroundColor: colors.primary[500]
            }}>

            {/* icon box */}
                <Box>
                </Box>

            {/* icon box */}
                <Box>
                    <IconButton type = "button" color = "warning" id="dark" onChange={()=>themeToggle.toggleColorMode()}>
                        <DarkModeOutlinedIcon/>
                    </IconButton>

                </Box>

            </Box>
        </>
    )
}
